import React from "react";
import Question from "./Question";
import Answer from "./Answer";
import Navigator from "./Navigator";
import "../css/Test.css";

function Test() {
  return (
    <div className="test">
      <div className="test-header">Header</div>
      <Question />
      <Answer />
      <Navigator />
    </div>
  );
}

export default Test;
